import React from 'react';
import Logo22 from "./Components/Images/logo22.png";
import Ap from "./Appin.module.css";

function Appin() {
  return (
    <div>
    <div className={Ap.im}>
       <img src={Logo22} className={Ap.img21}/>
     </div>
     <button type="submit" className={Ap.bt}>Let's Goo!!</button>
    </div> 
  )
}

export default Appin
